import React from "react";
import './index.css'

const SlotM = (Props) =>{

  // let x = '😄'
  // let y = '😄'
  // let z = '🥅'

  // object destructuring
  let {x,y,z} = Props

  if ( ( x === y) && (y === z) ){
    return (
      <>
       <h1>{x} {y} {z}</h1>
       <h2> All Are Maching </h2>
      </>
    )
  }

  else{
    return (
      <>
       <h1>{x} {y} {z}</h1>
       <h2> Not Maching </h2>
      </>
    )
  }


}




function App() {
  return (
    <>
    <div className="wrapper">
    <h1 className="heading"> 🎰 <span style={{fontWeight:'bold'}}>Slot machine Game</span> 🎰 </h1>
     <SlotM x={"😄"} y={"😄"} z={"😄"} />
     <hr/>
     <SlotM x={" 👍 "} y={" 🍊 "} z={" 🍇 "} />
     <hr/>
     <SlotM x={" 👍 "} y={" 🍊 "} z={" 🍇 "} />
     <hr/>
     </div>
     </>
    );
}

export default App;
